      SELECT + 96 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1 WHERE NOT NULL IS NOT NULL;
  - name: tab1
  - name: tab2

outputs:
